import React from 'react';

const List = ({ list }) => {
    return (
        <div style={{ textAlign: 'center', border: '2px solid black', width: '380px', marginLeft: '5px' }}>
            {list && (
                <ul>
                    {list.map(e => (
                        <li>{e}</li>
                    ))}
                </ul>
            )}
        </div>
    )
}

export default List;
